import React from 'react';
import './App.css';
import { BrowserRouter as Router, Link } from 'react-router-dom';
import Routes from 'Routes.js'; // Uvezi Routes komponentu

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Aplikacija za lov</h1>
          <div className="Menu">
            <Link to="/evidencija-lovaca"><Button text="EVIDENCIJA LOVACA" /></Link>
            <Link to="/raspored-aktivnosti-i-lova"><Button text="RASPORED AKTIVNOSTI I LOVA" /></Link>
            <Link to="/evidencija-prisutnosti"><Button text="EVIDENCIJA PRISUTNOSTI NA LOVNI DAN" /></Link>
            <Link to="/unos-divljaci"><Button text="UNOS DIVLJAČI" /></Link>
            <Link to="/unos-odstrijelene-divljaci"><Button text="UNOS ODSTRIJELENE DIVLJAČI" /></Link>
            <Link to="/bodovi"><Button text="BODOVI" /></Link>
          </div>
        </header>
        {/* Rendaj Routes komponentu gdje želiš da se prikaže sadržaj stranice */}
        <Routes />
      </div>
    </Router>
  );
}

function Button({ text }) {
  return (
    <div className="Button">
      {text}
    </div>
  );
}

export default App;
